import { Box } from "@chakra-ui/layout";
import React from "react";
import Card from "../common/Card";

const PlayerList = ({ list }) => {
  return (
    <div>
      <header>
        <h3>Forwards</h3>
      </header>
      {forwards.map((player) => {
        return (
          <Card image={player.image}>
            <Box>
              {player.name}
              {player.position}
            </Box>
          </Card>
        );
      })}

      <header>
        <h3>Backs</h3>
      </header>
      {backs.map((player) => {
        return (
          <Card image={player.image}>
            <Box>
              {player.name}
              {player.position}
            </Box>
          </Card>
        );
      })}

      <header>
        <h3>Coaches</h3>
      </header>
      {coaches.map((player) => {
        return (
          <Card image={player.image}>
            <Box>
              {player.name}
              {player.position}
            </Box>
          </Card>
        );
      })}
    </div>
  );
};

export default PlayerList;
